import React from "react";
import { Link } from "react-router-dom";

class ImageModule extends React.Component {
  constructor(props) {
    super(props);
    this.state = { module: props.module };
  }
  render() {
    console.log(this.state.module);
    return (
      <div>
        <div uk-lightbox="true">
          <a href={this.state.module.sizes.max_1920} data-caption="Caption">
            <img
              src={this.state.module.sizes.max_1920}
              width="100%"
              maxwidth="1920"
              alt=""
              uk-img="true"
            />
          </a>
        </div>
      </div>
    );
  }
}

class VideoModule extends React.Component {
  constructor(props) {
    super(props);
    this.state = { module: props.module };
  }
  render() {
    console.log(this.state.module);
    return (
      <div>
        <div uk-lightbox="true">
          <a href={this.state.module.sizes.max_1920} data-caption="Caption">
            <img
              src={this.state.module.sizes.max_1920}
              width="100%"
              maxwidth="1920"
              alt=""
              uk-img="true"
            />
          </a>
        </div>
      </div>
    );
  }
}

export default { VideoModule, ImageModule };
